import React from "react";
import { Route } from "react-router-dom";

/* Begin Import Components */
import ProductList from "./components/admin-components/productList";
import ProductCreate from "./components/admin-components/productCreate";
import ProductDelete from "./components/admin-components/productDelete";
import ProductEdit from "./components/admin-components/productEdit";
/* End Import Components */

function App(props) {

  return (
    <div className="container">
        {/* Begin Routes */}
        <Route path="/products/" exact component={ProductList} />
        <Route path="/products/add" exact component={ProductCreate} />
        <Route path="/products/:id/delete" exact component={ProductDelete} />
        <Route path="/products/:id/edit" exact component={ProductEdit} />
        {/* End Routes */}
    </div>
  );
}

export default App;
